        public long? entryID;
        public OrganicSpecies species;
        public OrganicGenus genus;
        public decimal? minG;
        public decimal? maxG;
        public decimal? minK;
        public decimal? maxK;
        public decimal? minP;
        public decimal? maxP;
        public IList<string> planetClass;
        public IList<string> atmosphereClass;
        public IList<string> atmosphereComposition; // The composition type and minimum amount comma separated and groups seperated by ';'  (i.e. "SulphurDioxide,0.5" )
        public IList<string> volcanism;
        public IList<string> primaryStar;           // a.k.a. Main Star; Star class and Luminosity (if needed). Group seperator of ';', if no ',' in group then just star class
        public IList<string> localStar;             // a.k.a. Parent Star; Local star to the body (this could be the primary star, but not always since many systems have more than one star)
        public IList<string> materials;             // The rare materials present on the body, used for Material type predictions
        public IList<string> systemBodies;          // Body types must be present in system (hard to predict if the system hasn't been fully scanned)
        public decimal? nebulaDistance;             // Must be within the distance (Ly) from nebula. (Need to incorporate "Catalogue of Galactic Nebulae" for this)
        public decimal? distanceFromArrival;        // Must be outside this distance (Ls) from arrival star.
        public decimal? geologicalsPresent;         // Must have this many geological present.
        public IList<string> regions;               // Galactic regions that this has been reported in. 

        [JsonIgnore]
        public bool isPredictable => minG != null ||
                                     maxG != null ||
                                     minK != null ||
                                     maxK != null ||
                                     minP != null ||
                                     maxP != null ||
                                     planetClass.Any() ||
                                     atmosphereClass.Any() ||
                                     atmosphereComposition.Any() ||
                                     volcanism.Any() ||
                                     primaryStar.Any() ||
                                     localStar.Any() ||
                                     materials.Any() ||
                                     systemBodies.Any() ||
                                     nebulaDistance != null ||
                                     distanceFromArrival != null ||
                                     geologicalsPresent != null ||
                                     regions.Any();

        // dummy used to ensure that the static constructor has run
        public OrganicVariant () : this( "" )
        { }

        private OrganicVariant ( string edname,
                                 long? entryID = null,
                                 OrganicSpecies species = null,
                                 OrganicGenus genus = null,
                                 decimal? minG = null,
                                 decimal? maxG = null,
                                 decimal? minK = null,
                                 decimal? maxK = null,
                                 decimal? minP = null,
                                 decimal? maxP = null,
                                 string planetClass = null,
                                 string atmosphereClass = null,
                                 string atmosphereComposition = null,
                                 string volcanism = null,
                                 string primaryStar = null,
                                 string localStar = null,
                                 string materials = null,
                                 string systemBodies = null,
                                 decimal? nebulaDistance = null,
                                 decimal? distanceFromArrival = null,
                                 decimal? geologicalsPresent = null,
                                 string regions = null
            ) : base( edname, edname )
        {
            this.entryID = entryID;
            this.species = species;
            this.genus = genus;
            this.minG = minG;
            this.maxG = maxG;
            this.minK = minK;
            this.maxK = maxK;
            this.minP = minP;
            this.maxP = maxP;
            this.planetClass = !string.IsNullOrEmpty( planetClass ) ? planetClass.Split( ';' ).ToList() : new List<string>();
            this.atmosphereClass = !string.IsNullOrEmpty( atmosphereClass ) ? atmosphereClass.Split( ';' ).ToList() : new List<string>();
            this.atmosphereComposition = !string.IsNullOrEmpty( atmosphereComposition ) ? atmosphereComposition.Split( ';' ).ToList() : new List<string>();
            this.volcanism = !string.IsNullOrEmpty( volcanism ) ? volcanism.Split( ';' ).ToList() : new List<string>();
            this.primaryStar = !string.IsNullOrEmpty( primaryStar ) ? primaryStar.Split( ';' ).ToList() : new List<string>();
            this.localStar = !string.IsNullOrEmpty( localStar ) ? localStar.Split( ';' ).ToList() : new List<string>();
            this.materials = !string.IsNullOrEmpty( materials ) ? materials.Split( ',' ).ToList() : new List<string>();
            this.systemBodies = !string.IsNullOrEmpty( systemBodies ) ? systemBodies.Split( ',' ).ToList() : new List<string>();
            this.nebulaDistance = nebulaDistance;
            this.distanceFromArrival = distanceFromArrival;
            this.geologicalsPresent = geologicalsPresent;
            this.regions = !string.IsNullOrEmpty( regions ) ? regions.Split( ',' ).ToList() : new List<string>();
        }

        /// <summary>
        /// Try getting data from the entryid first, then use variant name as a fallback
        /// </summary>
        public static OrganicVariant Lookup ( long? entryId, string edname )
        {
            try
            {
                if ( entryId != null )
                {
                    return AllOfThem.Single( a => a.entryID == entryId );
                }
            }
            catch ( InvalidOperationException e )
            {
                if ( AllOfThem.Count( a => a.entryID == entryId ) > 1 )
                {
                    Logging.Error( $"Duplicate EntryID value {entryId} in {nameof( OrganicVariant )}.", e );
                }
                else if ( AllOfThem.All( a => a.entryID != entryId ) )
                {
                    Logging.Error( $"Unknown EntryID value {entryId} with normalized edname {NormalizeVariant( edname )} in {nameof( OrganicVariant )}.", e );
                }
            }

            return FromEDName( NormalizeVariant( edname ) ) ??
                   new OrganicVariant( NormalizeVariant( edname ), entryId ); // No match.
        }

        public static new OrganicVariant FromEDName ( string edname )
        {
            return ResourceBasedLocalizedEDName<OrganicVariant>.FromEDName( NormalizeVariant( edname ) );
        }

        public static string NormalizeVariant ( string edname )
        {
            return edname?
                .Replace( "Codex_Ent_", "" )
                .Replace( "$", "" )
                .Replace( "_Name;", "" )
                .Replace( "_name;", "" )
                .Replace( ";", "" );
        }
    }
